import { useState } from 'react';
import { useNavigation } from '@react-navigation/native';
import { View, Text, StyleSheet, Pressable } from 'react-native';
import { useFonts } from 'expo-font';
import { IconHomeOutline } from './../../assets/images/js/icon_home_outline.js';
import { IconHomeSolid } from './../../assets/images/js/icon_home_solid.js';
import { IconInsightsOutline } from './../../assets/images/js/icon_insights_outline.js';
import { IconInsightsSolid } from './../../assets/images/js/icon_insights_solid.js';
import { IconLocalLibraryOutline } from './../../assets/images/js/icon_local_library_outline.js';
import { IconLocalLibrarySolid } from './../../assets/images/js/icon_local_library_solid.js';
import { IconTrioOutline } from './../../assets/images/js/icon_trio_outline.js';
import { IconTrioSolid } from './../../assets/images/js/icon_trio_solid.js';

export const Footer = () => {
  const navigation = useNavigation();
  const [selected, setSelected] = useState(0);

  const [loaded] = useFonts({
    ObjektivRegular: require('./../../assets/fonts/ObjektivMk2-Regular.ttf'),
    ObjektivBold: require('./../../assets/fonts/ObjektivMk2-Bold.ttf'),
  });

  if (!loaded) {
    return null;
  }

  return (
    <View style={styles.container}>
      <Pressable
        opacity={selected === 1 ? 1 : 0.5}
        onPress={() => [setSelected(1), navigation.navigate('HomeScreen')]}
        style={styles.iconButton}
      >
        {selected === 1 ? (
          <IconHomeSolid style={styles.icon} />
        ) : (
          <IconHomeOutline style={styles.icon} />
        )}
        <Text style={styles.label}>myTrio</Text>
      </Pressable>

      <Pressable
        opacity={selected === 2 ? 1 : 0.5}
        onPress={() => [setSelected(2), navigation.navigate('InsightsScreen')]}
        style={styles.iconButton}
      >
        {selected === 2 ? (
          <IconInsightsSolid style={styles.icon} />
        ) : (
          <IconInsightsOutline style={styles.icon} />
        )}

        <Text style={styles.label}>Insights</Text>
      </Pressable>

      <Pressable
        opacity={selected === 3 ? 1 : 0.5}
        onPress={() => [setSelected(3), navigation.navigate('SupportScreen')]}
        style={styles.iconButton}
      >
        {selected === 3 ? (
          <IconLocalLibrarySolid style={styles.icon} />
        ) : (
          <IconLocalLibraryOutline style={styles.icon} />
        )}
        <Text style={styles.label}>Support</Text>
      </Pressable>

      <Pressable
        opacity={selected === 4 ? 1 : 0.5}
        onPress={() => [setSelected(4), navigation.navigate('BasicsScreen')]}
        style={styles.iconButton}
      >
        {selected === 4 ? (
          <IconTrioSolid style={styles.icon} />
        ) : (
          <IconTrioOutline style={styles.icon} />
        )}

        <Text style={styles.label}>Device</Text>
      </Pressable>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'space-around',
    alignItems: 'center',
    height: Dimensions.FOOTER_HEIGHT,
    width: '100%',
    backgroundColor: Colors.WHITE,
    //backgroundColor: 'red',
  },
  iconButton: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: Dimensions.FOOTER_HEIGHT,
    width: 100,
    //backgroundColor: 'gold',
  },
  icon: {
    height: 22,
    width: 24,
    color: Colors.HERO_BLUE,
    //backgroundColor: 'lightblue',
  },
  label: {
    marginTop: 5,
    alignItems: 'center',
    justifyContent: 'center',
    fontFamily: Fonts.FONT_FACE_BUTTON,
    fontSize: Fonts.FONT_SIZE_BUTTON * 0.9,
    color: Colors.HERO_BLUE,
    //backgroundColor: 'green',
  },
});
